problem_key:
From a circular piece of paper with radius $BC$, Jeff removes the unshaded sector shown.  Using the larger shaded sector, he joins edge $BC$ to edge $BA$ (without overlap) to form a cone of radius 12 centimeters and of volume $432\pi$ cubic centimeters.  What is the number of degrees in the measure of angle $ABC$ of the sector that is not used? [asy]
import graph;
defaultpen(linewidth(0.7));
fill((0,0)--dir(20)..dir(60)..dir(100)..dir(140)..dir(180)..dir(220)..dir(260)..dir(300)--cycle,gray);
draw((0,0)--dir(20)..dir(60)..dir(100)..dir(140)..dir(180)..dir(220)..dir(260)..dir(300)--(0,0));
draw(dir(300)..dir(320)..dir(340)..dir(360)..dir(20),dotted);
label("$C$",dir(20),E);
label("$A$",dir(300),SE);
label("$B$",(0,0),W);[/asy]

Sandy's daughter has a playhouse in the back yard. She plans to cover the one shaded exterior wall and the two rectangular faces of the roof, also shaded, with a special siding to resist the elements. The siding is sold only in 8-foot by 12-foot sections that cost $\$27.30$ each. If Sandy can cut the siding when she gets home, how many dollars will be the cost of the siding Sandy must purchase?

[asy]
import three;
size(101);
currentprojection=orthographic(1/3,-1,1/2);
real w = 1.5;
real theta = pi/4;
string dottedline = "2 4";
draw(surface((0,0,0)--(8,0,0)--(8,0,6)--(0,0,6)--cycle),gray(.7)+opacity(.5));
draw(surface((0,0,6)--(0,5cos(theta),6+5sin(theta))--(8,5cos(theta),6+5sin(theta))--(8,0,6)--cycle),gray(.7)+opacity(.5));
draw(surface((0,5cos(theta),6+5sin(theta))--(8,5cos(theta),6+5sin(theta))--(8,10cos(theta),6)--(0,10cos(theta),6)--cycle),gray

(.7)+opacity(.5));
draw((0,0,0)--(8,0,0)--(8,0,6)--(0,0,6)--cycle,black+linewidth(w));
draw((0,0,6)--(0,5cos(theta),6+5sin(theta))--(8,5cos(theta),6+5sin(theta))--(8,0,6)--cycle,black+linewidth(w));
draw((8,0,0)--(8,10cos(theta),0)--(8,10cos(theta),6)--(8,5cos(theta),6+5sin(theta)),linewidth(w));
draw((0,0,0)--(0,10cos(theta),0)--(0,10cos(theta),6)--(0,0,6),linetype(dottedline));
draw((0,5cos(theta),6+5sin(theta))--(0,10cos(theta),6)--(8,10cos(theta),6)--(8,0,6),linetype(dottedline));
draw((0,10cos(theta),0)--(8,10cos(theta),0),linetype(dottedline));
label("8' ",(4,5cos(theta),6+5sin(theta)),N);
label("5' ",(0,5cos(theta)/2,6+5sin(theta)/2),NW);
label("6' ",(0,0,3),W);
label("8' ",(4,0,0),S);
[/asy]

The water tank in the diagram below is in the shape of an inverted right circular cone. The radius of its base is 16 feet, and its height is 96 feet. The water in the tank is $25\%$ of the tank's capacity.  The height of the water in the tank can be written in the form $a\sqrt[3]{b}$, where $a$ and $b$ are positive integers and $b$ is not divisible by a perfect cube greater than 1.  What is $a+b$?

[asy]
size(150);
defaultpen(linewidth(.8pt)+fontsize(8pt));

draw(shift(0,96)*yscale(0.5)*Circle((0,0),16));
draw((-16,96)--(0,0)--(16,96)--(0,96));

draw(scale(0.75)*shift(0,96)*yscale(0.5)*Circle((0,0),16));

draw((-18,72)--(-20,72)--(-20,0)--(-18,0));
label("water's height",(-20,36),W);

draw((20,96)--(22,96)--(22,0)--(20,0));
label("96'",(22,48),E);

label("16'",(8,96),S);
[/asy]

The circle graph below represents the opinions of $100$ students about their favorite sports. Each student chose exactly one of these four options: Basketball, Hockey, Football, and Other. The following statements are true about the graph:

$\bullet$  The number of students who chose Basketball is three times the number of students who chose Other.

$\bullet$  Ten more students chose Football than chose Hockey.

$\bullet$  The percent of students who chose Basketball plus the percent of students who chose Football equal $65\%.$

What percent of the students chose Basketball?

[asy]
draw(circle((0,0),1),linewidth(2));
draw((0,0)--(0,1),linewidth(2));
draw((0,0)--dir(-35),linewidth(2));
draw((0,0)--dir(137),linewidth(2));
draw((0,0)--dir(-115),linewidth(2));

label("Other",1.2*dir(100));
label("Football",1.5*dir(10));
label("Hockey",1.2*dir(-80));
label("Basketball",1.6*dir(180));

label("Favorite Sports of 100 Students",(0,1.5));
[/asy]

