What is the area of the semi-circle with center $K$?

Bob rolls a fair six-sided die each morning. If Bob rolls a composite number, he eats sweetened cereal. If he rolls a prime number, he eats unsweetened cereal. If he rolls a 1, then he rolls again. In a non-leap year, what is the expected value of the difference between the number of days Bob eats unsweetened cereal and the number of days he eats sweetened cereal? [asy]
import olympiad; import geometry; size(50);

defaultpen(linewidth(0.8));
draw(unitsquare);
draw((0,1)--(0.5,1.5)--(1.5,1.5)--(1.5,0.5)--(1,0)^^(1.5,1.5)--(1,1));
dot((0.3,0.2)); dot((0.7,0.2));
dot((0.3,0.5)); dot((0.7,0.5));
dot((0.3,0.8)); dot((0.7,0.8));
dot((1.125,0.375)); dot((1.25,0.75)); dot((1.375,1.125));
dot((0.5,0.5/3 + 1)); dot((1.0,4/3));
[/asy]

Piravena must make a trip from $A$ to $B$, then from $B$ to $C$, then from $C$ to $A$.  Each of these three parts of the trip is made entirely by bus or entirely by airplane.  The cities form a right-angled triangle as shown, with $C$ a distance of 3000 km from $A$ and with $B$ a distance of 3250 km from $A$. To take a bus, it costs Piravena $\$0.15$ per kilometer. To take an airplane, it costs her a $\$100$ booking fee, plus $\$0.10$ per kilometer. [asy]

pair A, B, C;

C=(0,0);

B=(0,1250);

A=(3000,0);

draw(A--B--C--A);

label("A", A, SE);

label("B", B, NW);

label("C", C, SW);

label("3000 km", (A+C)/2, S);

label("3250 km", (A+B)/2, NE);

draw((0,125)--(125,125)--(125,0));

[/asy]

Piravena chose the least expensive way to travel between cities.  What was the total cost?

In the figure, $PA$ is tangent to semicircle $SAR$, $PB$ is tangent to semicircle $RBT$, and $SRT$ is a straight line.  If arc $AS$ is $58^\circ$ and arc $BT$ is $37^\circ$, then find $\angle APB$, in degrees.

[asy]
import graph;

unitsize(1.5 cm);

pair A, B, P, R, S, T;
pair[] O;
real[] r;

r[1] = 1;
r[2] = 0.8;

S = (-2*r[1],0);
O[1] = (-r[1],0);
R = (0,0);
O[2] = (r[2],0);
T = (2*r[2],0);
A = O[1] + dir(180 - 58)*r[1];
B = O[2] + dir(37)*r[2];
P = extension(A, A + rotate(90)*(A - O[1]), B, B + rotate(90)*(B - O[2]));

draw(S--T);
draw(arc(O[1],r[1],0,180));
draw(arc(O[2],r[2],0,180));
draw(A--P--B);

label("$A$", A, NW);
label("$B$", B, NE);
label("$P$", P, N);
label("$R$", R, dir(270));
label("$S$", S, SW);
label("$T$", T, SE);
[/asy]

